    return (
        <div>
            <div className="container">
                <CounterSelector onSelectCounter={handleCounterSelect} />
                <CategoryDisplay />
                <ConsultationsTable consultations={consultations} />
                <hr />
                <h3>Add Consultation:</h3>
            </div>
        </div>
    );
}

